// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.7;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract HospitalSystem is Ownable {

    struct Patient {
        string cnic;
        string name;
        string guardian;
        uint256 dateOfBirth; // timestamp
        string emergencyContact; // mobile number
        bool exists;
    }

    struct Prescription {
        string doctorId;
        string patientId;
        string pharmacyId;
        string file;
        uint createdAt;
        bool completed;
        bool exists;
    }

    struct LabTest {
        string doctorId;
        string patientId;
        string laboratoryId;
        string file;
        uint createdAt;
        bool completed;
        bool exists;
    }

    mapping(string => Patient) private patients; // cnic to patient map
    mapping(string => Prescription) private prescriptions;
    mapping(string => LabTest) private labTests;

    event PatientAdded (
        string cnic,
        string name,
        string guardian,
        uint256 dateOfBirth,
        string emergencyContact
    );

    event PrescriptionAdded (
        string prescriptionId,
        string doctorId,
        string patientId,
        string pharmacyId,
        uint createdAt,
        string ipfsHash
    );

    event LabTestAdded (
        string labTestId,
        string doctorId,
        string patientId,
        string laboratoryId,
        uint createdAt,
        string ipfsHash
    );

    constructor() {}

    function getPatient(string memory _cnic) public view returns (Patient memory) {
        return patients[_cnic];
    }

    function getPrescription(string memory _uuid) public view returns (Prescription memory) {
        return prescriptions[_uuid];
    }

    function getLabTest(string memory _uuid) public view returns (LabTest memory) {
        return labTests[_uuid];
    }

    function addPatient(string memory _cnic, string memory _name, string memory _guardian, uint256 _dateOfBirth, string memory _emergencyContact)
    public onlyOwner {
        patients[_cnic] = Patient(_cnic, _name, _guardian, _dateOfBirth, _emergencyContact, true);
        emit PatientAdded(_cnic, _name, _guardian, _dateOfBirth, _emergencyContact);
    }

    function addPrescription(string memory _uuid, string memory _doctorId, string memory _patientId, string memory _pharmacyId, string memory _file)
    public onlyOwner {
        prescriptions[_uuid] = Prescription(_doctorId, _patientId, _pharmacyId, _file, block.timestamp, false, true);
        emit PrescriptionAdded(_uuid, _doctorId, _patientId, _pharmacyId, block.timestamp, _file);
    }

    function addLabTest(string memory _uuid, string memory _doctorId, string memory _patientId, string memory _labId, string memory _file)
    public onlyOwner {
        labTests[_uuid] = LabTest(_doctorId, _patientId, _labId, _file, block.timestamp, false, true);
        emit LabTestAdded(_uuid, _doctorId, _patientId, _patientId, block.timestamp, _file);
    }

}
